-- ----------------------------
-- Table structure for `vtr_subscribe`
-- ----------------------------
DROP TABLE IF EXISTS `vtr_subscribe`;
CREATE TABLE `vtr_subscribe` (
  `subscribe_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '标识',
  `dept_id` bigint(20) DEFAULT NULL COMMENT '机构',
  `visitor_name` varchar(50) DEFAULT NULL COMMENT '姓名',
  `card_number` varchar(50) DEFAULT NULL COMMENT '识别卡号',
  `id_number` varchar(50) DEFAULT NULL COMMENT '身份证号',
  `birthday` date DEFAULT NULL COMMENT '出生日期',
  `sex` char(1) DEFAULT NULL COMMENT '用户性别（0男 1女 2未知）',
  `contact` varchar(50) DEFAULT NULL COMMENT '联系方式',
  `province` varchar(10) DEFAULT NULL COMMENT '省',
  `city` varchar(10) DEFAULT NULL COMMENT '市',
  `region` varchar(10) DEFAULT NULL COMMENT '区',
  `full_address` varchar(100) DEFAULT NULL COMMENT '详细地址',
  `personnel_type` char(2) DEFAULT NULL COMMENT '人员类型',
  `duty_time` datetime DEFAULT NULL COMMENT '在岗时间',
  `approach_time` datetime DEFAULT NULL COMMENT '进场时间',
  `validity` datetime DEFAULT NULL COMMENT '有效期',
  `data_dissemination` char(255) DEFAULT NULL COMMENT '数据下发',
  `face_path` varchar(100) DEFAULT NULL COMMENT '人脸',
  `certificate_path` varchar(100) DEFAULT NULL COMMENT '证件',
  `data_state` varchar(10) DEFAULT NULL COMMENT '数据状态',
  `avatar` varchar(100) DEFAULT NULL COMMENT '头像路径',
  PRIMARY KEY (`subscribe_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='访客预约';

